import React from 'react';
import { BrowserRouter } from 'react-router-dom/cjs/react-router-dom.min';
import AppRouter from './components/AppRouter';
import NavBar from './components/NavBar';
import './custom.css';
import './App.css';

const App = () => {
	return (
		<BrowserRouter>
			<NavBar />
			<AppRouter />
		</BrowserRouter>
	);
};

export default App;
